import { useState } from "react";
import axios from "axios";

function Form()
{
    return(
        <>
            <div>
                <form>
                    <label>Name: </label><input type="text"/><br></br>
                    <label>Url: </label><input type="text"/><br></br>
                    <label>Text: </label><input type="text"/><br></br>
                    <input type="submit"/>
                </form>
            </div>
        </>
    )
}

export default Form;
